/** @format */
import React from 'react';

function Nav() {
	return (
		<>
			<div className='px-14 py-6 bg-black text-white'>
				<div className='flex justify-between	'>
					<h1 className='font-extrabold'>My Logo</h1>
					<div className='flex'>
						<a>Project</a>
						<a className='ml-2'>Team</a>
					</div>
				</div>
			</div>
		</>
	);
}

export default Nav;
